Record-breaking temperatures resulting from climate change are occurring more often, lasting longer, and are more intense than ever before. This is a problem that affects us all, putting our lives at risk. 

@drsanjaygupta speaks with Dr. June Spector about how we can take better care of our health during extreme heat and why some city neighborhoods are hotter than others.

Tap the link in our bio to listen to the latest episode of Chasing Life.
